const router = createBrowserRouter([
    {
        path: '/',
        element: <RootLayout/>,
        errorElement: <ErrorPage/>,
        children: [
            {
                path: '/',
                element: <HomePage/> // compmonent that should be rendered
            },
            {
                path: '/products',
                element: <ProductsPage/>
            },
            {
                path: '/products/',
                element: <ProductsDetailPage/>
            }
        ]
    },

]);

export default router;
